import React, { useState } from "react";
import TodoForm from "./TaskForm";
import TaskList from "./TaskList";



export default function MainTAsk() {
  const [tasks, setTasks] = useState([]);
  const [currentTask, setCurrentTask] = useState(null);
  const handleAddTask = e => {
    e.preventDefault();
    setTasks(tasks => [...tasks, currentTask]);
    setCurrentTask(null);
  
  };
  

  const handleRemoveTask = index => {
    const newTasks = [...tasks];
    newTasks.splice(index, 1);
    setTasks(newTasks);
  };
  return (
    <div style={{flex:4}} className="App content">
      	<section id="content">	
	<main>
		<div class="head-title">
			<div class="left">
				<h1>Dashboard</h1>
				<ul class="breadcrumb">
					<li>
						<a href="#">Dashboard</a>
					</li>
					<li><i class='bx bx-chevron-right' ></i></li>
					<li>
						<a class="active" href="#">Home</a>
					</li>
				</ul>
			</div>
			<a href="#" class="btn-download">
				<i class='bx bxs-cloud-download' ></i>
				<span class="text">Download PDF</span>
			</a>
		</div>

		

		<div class="table-data">
			<div class="order">
				
				<div class="todo">
				<div class="head">
					<h3>Task <span style={{fontSize:"14px"}}>(in progress)</span></h3>
					
					<i class='bx bx-filter' ></i>
				</div>
				<ul class="todo-list">
				{users.map((row) => (
					<li class="not-completed">
						<p>{row.name}</p>
						<span>{row.time}</span>
					</li>
					))}
				</ul>
			</div>

	  
	
  
			</div>
			<div class="todo">
				<div class="head">
					<h3>Task<span style={{fontSize:"14px"}}>(completed)</span></h3>
					<i class='bx bx-plus' ></i>
					<i class='bx bx-filter' ></i>
				</div>
				<ul class="todo-list">
					<li class="completed">
						<p>Task</p>
						<i class='bx bx-dots-vertical-rounded' ></i>
					</li>
				</ul>
			</div>
		</div>
	</main>
</section>
    </div>
  );
}
